DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `p_alerUserBaseTable`()
BEGIN
DECLARE v_sql VARCHAR(1000);
DECLARE aa INT;
DECLARE bb INT;
SET aa = 0;
SET bb = 0;
  WHILE
    aa <100 DO 
     SET v_sql = CONCAT('ALTER TABLE  user_base_info_',LPAD(aa,2,0),' ADD COLUMN pkStatus TINYINT(1) DEFAULT 0  NULL  COMMENT \'PK状态 0:未PK;1:PK\' AFTER gameId');
     SET @v_sql=v_sql;
     PREPARE stmt FROM @v_sql;  
     EXECUTE stmt;     
     DEALLOCATE PREPARE stmt;   
